import React from 'react';
import{ Link } from 'react-router-dom';
import './components.css'

function Mechanics() {
  return (
    <div>
      <h2>Mechanics</h2>
      <ol>
        <li>time</li>
        <li>space</li>
        <li>chance</li>
      </ol>
      <button className="button">
        <Link className="buttonLink" to='/'>Home</Link>
      </button>
    </div>
  );
}

export default Mechanics;
